import React from 'react';
import { Outlet } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';

function Layout() {
  return (
    <>
      <Header />
      <main>
        <Outlet /> {/* Yeh jagah pe current route ka page render hoga */}
      </main>
      <Footer />
    </>
  );
}

export default Layout;
